import {Link} from 'react-router-dom'
function Obj(props){
const ssilka="https://image.tmdb.org/t/p/w500"
return(   
<Link to="/film" className="movie-item">
<div >
    <img src={ssilka+props.data.poster_path}/>
    <h1>{props.data.title}</h1>
    </div>
</Link>
);
}
export default Obj;
